import React from "react";
import { contactdata } from "../../data/contactdata";
import ContactApp from "./ContactApp";

function Contact() {
  return (
    <div>
      {contactdata.map((cnt, index) => (
        <ContactApp data={cnt} dataindex={index} />
      ))}
    </div>
  );
}

export default Contact;
